DROP TABLE IF EXISTS `admin_angent_order`;
CREATE TABLE `admin_angent_order` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `order_sn` varchar(20) DEFAULT NULL,
  `order_type` int(3) NOT NULL DEFAULT '0' COMMENT '1,给玩家充值,\r\n2,后台充值\r\n3,代理给下级代理充值,\r\n4,获得上级充值,\r\n5,下级代理充值提成,\r\n6,提现操作,\r\n7,转让,\r\n8,玩家充值退回\r\n0,异常数据',
  `agent_id` int(11) NOT NULL COMMENT '代理ID',
  `op_agent_id` int(11) DEFAULT NULL COMMENT '本次金币操作时，对应的代理ID',
  `op_player_id` int(11) DEFAULT NULL COMMENT '本次金币操作时，对应的玩家的ID',
  `game_gold` int(11) NOT NULL DEFAULT '0' COMMENT '收入或支出的游戏币',
  `befor_gold` int(11) NOT NULL DEFAULT '0' COMMENT '变动前金币数量',
  `after_gold` int(11) NOT NULL DEFAULT '0' COMMENT '变动后金币数量',
  `order_status` int(3) NOT NULL DEFAULT '0' COMMENT '0，失败；1，成功',
  `tread_time` int(11) NOT NULL COMMENT '交易时间（添加记录的时间）',
  `tarff_id` int(11) DEFAULT '0' COMMENT '套餐ID',
  `order_desc` text COMMENT '订单备注',
  `show` smallint(1) unsigned NOT NULL DEFAULT '1' COMMENT '1是显示 0是隐藏 （软删除）',
  PRIMARY KEY (`id`),
  KEY `angent_id` (`agent_id`) USING BTREE,
  KEY `op_angent_id` (`op_agent_id`) USING BTREE,
  KEY `op_player_id` (`op_player_id`) USING BTREE,
  KEY `order_type` (`order_type`) USING BTREE,
  KEY `order_status` (`order_status`) USING BTREE,
  KEY `order_sn` (`order_sn`) USING BTREE,
  KEY `tarffid` (`tarff_id`) USING BTREE,
  KEY `gamegold` (`game_gold`) USING BTREE,
  KEY `treadtime` (`tread_time`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 COMMENT='代理充值';

