-- Table structure for t_users
-- ----------------------------
DROP TABLE IF EXISTS `t_users`;
CREATE TABLE `t_users` (
  `userid` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '用户ID',
  `account` varchar(64) NOT NULL DEFAULT '' COMMENT '账号',
  `name` varchar(32) DEFAULT NULL COMMENT '用户昵称',
  `sex` int(1) DEFAULT NULL,
  `headimg` varchar(256) DEFAULT NULL,
  `lv` smallint(6) unsigned DEFAULT '1' COMMENT '1 普通玩家 2 显示代理后台 3 是能看到管理后台 和 代理后台',
  `exp` int(11) unsigned DEFAULT '0',
  `coins` float(11,3) unsigned DEFAULT '0.000',
  `testcoins` float(11,3) unsigned DEFAULT '0.000',
  `treasure` float(11,3) unsigned DEFAULT '0.000',
  `gems` int(11) unsigned DEFAULT '0',
  `zhuans` int(11) unsigned DEFAULT '0',
  `roomid` varchar(8) DEFAULT NULL,
  `history` text NOT NULL,
  `cHistory` text NOT NULL COMMENT '金币模式战绩',
  `status` smallint(2) unsigned NOT NULL DEFAULT '1',
  `RegisterDate` int(11) unsigned DEFAULT NULL COMMENT '注册日期',
  `match_roomid` varchar(8) DEFAULT NULL,
  `pay` int(5) NOT NULL DEFAULT '0',
  `kong` int(5) unsigned NOT NULL DEFAULT '0',
  `referee` int(11) unsigned NOT NULL DEFAULT '0',
  `commission` int(11) unsigned DEFAULT '0' COMMENT '能不能游戏',
  `quan` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`userid`),
  UNIQUE KEY `account` (`account`) USING BTREE,
  KEY `gems` (`gems`) USING BTREE,
  KEY `roomid` (`roomid`) USING BTREE,
  KEY `history` (`history`(255)) USING BTREE,
  KEY `name` (`name`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=15514 DEFAULT CHARSET=utf8;

