-- ----------------------------
-- Event structure for del_games
-- ----------------------------
DROP EVENT IF EXISTS `del_games`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` EVENT `del_games` ON SCHEDULE EVERY 1 HOUR STARTS '2019-09-29 00:00:00' ON COMPLETION NOT PRESERVE ENABLE DO DELETE FROM t_games_archive WHERE  unix_timestamp(now()) - create_time > 60*60*25
;
;;
DELIMITER ;

-- ----------------------------
-- Event structure for del_history
-- ----------------------------
DROP EVENT IF EXISTS `del_history`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` EVENT `del_history` ON SCHEDULE EVERY 1 HOUR STARTS '2019-09-29 00:00:00' ON COMPLETION NOT PRESERVE ENABLE DO DELETE FROM t_history WHERE  unix_timestamp(now()) - storetime > 60*60*24
;;
DELIMITER ;
